def neta():
    ck_pth = '/tmp/netease.txt'
    ck_jar = LWPCookieJar(ck_pth)
    sess.cookies = ck_jar
    try:
        ck_jar.load()
    except:
        ck_jar.save()

    csrf_token = ''
    for cookie in sess.cookies:
        if cookie.name == '__csrf':
            csrf_token = cookie.value
            break
    _url = 'http://music.163.com'
    # _url += '/weapi/artist/top'
    _url = 'https://music.163.com/weapi/user/playlist?csrf_token='
    params = dict(
        uid='381661302',
        offset=0,
        total=True,
        limit=100
    )
    params.update({'csrf_token': csrf_token})
    params = encrypt.encrypted_request(params)
    res = sess.post(_url, data=params, headers=post_headers.headers)
    sess.cookies.save()
    try:
        print(res.json())
    except:
        print(res.content)


